import React, {Component} from 'react';
import { Typeahead } from 'react-bootstrap-typeahead';

import {Button, Col, Container, Form, Modal, Row, Badge} from 'react-bootstrap';
import {Carousel, Accordion, Card} from 'react-bootstrap';
import Meta from '../meta.json';
import {parseSuperCategories, parseSubCategories} from './cocoParser';
import {ClassesCOCO} from './classesCOCO';

export function COCO () {

	const [subClasses, setSubClasses] = React.useState({items: ['']});

	// function appendSubclasses(e:string[]){
	// 	//e.preventDefault();
	// 	if(!subClasses?.items.includes(e[0]) && e[0]!== undefined) {
	// 		const prevSubsState = subClasses;
	// 		prevSubsState?.items.push(e[0]);
	// 		setSubClasses(prevSubsState);
