	// 	}
	//
	// }

	return(

		<Container>
			<Row>
				<Col xs={12} md={8}>
					<Carousel fade>
						<Carousel.Item>
							<img
								className="d-block w-100"
								src={process.env.PUBLIC_URL+'/imgs/newYorkTimes.jpg'}
								alt="First slide"
							/>
							<Carousel.Caption>
								<h3>First slide label</h3>
								<p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
							</Carousel.Caption>
						</Carousel.Item>
						<Carousel.Item>
							<img
								className="d-block w-100"
								src={process.env.PUBLIC_URL+'/imgs/newYorkTimes.jpg'}
								alt="Second slide"
							/>

							<Carousel.Caption>
								<h3>Second slide label</h3>
								<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
							</Carousel.Caption>
						</Carousel.Item>
						<Carousel.Item>
							<img
								className="d-block w-100"
								src={process.env.PUBLIC_URL+'/imgs/newYorkTimes.jpg'}
								alt="Third slide"
							/>

							<Carousel.Caption>
								<h3>Third slide label</h3>
								<p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
							</Carousel.Caption>
						</Carousel.Item>
					</Carousel>
				</Col>
				<Col xs={6} md={4}>
					<Accordion defaultActiveKey="0">
						<Card>
							<Accordion.Toggle as={Card.Header} eventKey="0">
									Classes
							</Accordion.Toggle>
							<Accordion.Collapse eventKey="0">
								<Card.Body>
									<ClassesCOCO></ClassesCOCO>
									{/*<Form>*/}
									{/*	<Form.Group controlId="formBasicClasses">*/}
									{/*		<p>Superclasses: </p>*/}
									{/*		<Form.Control size="sm" as="select">*/}
									{/*			<option value='0'>all</option>*/}
									{/*			{*/}
									{/*				parseSuperCategories().map((item,it)=>{*/}

									{/*					return <option key={it+1} value={it+1}>{item}</option>;*/}

									{/*				})*/}
									{/*			}*/}
									{/*			)*/}
									{/*		</Form.Control>*/}
									{/*		<p></p>*/}
									{/*		<p>Subclasses: </p>*/}

									{/*	</Form.Group>*/}

									{/*	<Typeahead*/}
									{/*		id="toggle-example"*/}
									{/*		options={parseSubCategories()}*/}
									{/*		onChange={(e)=>{ appendSubclasses(e);} }*/}
									{/*		placeholder="Subclasses...">*/}
									{/*	</Typeahead>*/}
									{/*	{*/}
									{/*		subClasses?.items.map((item,it)=>{*/}

									{/*			return <Badge key={it} variant="success">{item}</Badge>;*/}
									{/*		})*/}
									{/*	}*/}

									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*	<br></br>*/}
									{/*</Form>*/}


								</Card.Body>
							</Accordion.Collapse>
						</Card>
						<Card>
							<Accordion.Toggle as={Card.Header} eventKey="1">
									Filters
							</Accordion.Toggle>
							<Accordion.Collapse eventKey="1">
								<Card.Body>Hello! Im another body</Card.Body>
							</Accordion.Collapse>
						</Card>
					</Accordion>
				</Col>
			</Row>

			<Row>
				<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
				</Col>
				<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
				</Col>
				<Col xs={6} md={4}>
						.col-xs-6 .col-md-4
				</Col>
			</Row>
		</Container>
	);


}
